import Container from "react-bootstrap/Container";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import logo from "../image/inshaallah_logo.jpg";
import "../header/Navbar.css";
import {Navigate, Outlet} from "react-router-dom";
import { LinkContainer } from "react-router-bootstrap";
import {Link} from "react-router-dom";

export default function WebNavbar(){
    
    
    return (
      <>
        <Navbar collapseOnClick expand="lg" bg="primary" variant="white">
      <Container>
        <Navbar.Brand ><img src={logo} alt="log" height="60px" width="60px" className="rounded-circle"></img>
        </Navbar.Brand>
        <div className="row" >
        <div className="col-xs-3"><h5>TrustOn Bank</h5>
        <h6>A bank for financial inclusion</h6>
        </div>
        </div>
        
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav" style={{paddingLeft:"2rem"}}>
         
          <Nav className="me-auto">
            {/* <Nav.Link active href="home">HOME</Nav.Link> */}
            <Link to="/home">Home</Link>
            <LinkContainer to="openaccount">
            <Nav.Link >OPENACCOUNT</Nav.Link>

            </LinkContainer>
            <NavDropdown title="SERVICE" id="collasible-nav-dropdown">
              <NavDropdown.Item href="service/deposit">DEPOSIT</NavDropdown.Item>
              <NavDropdown.Item href="service/loan">LOAN</NavDropdown.Item>
              <NavDropdown.Item href="service/trajection">TRAJECTION</NavDropdown.Item>
            </NavDropdown>
            <Nav.Link href="personalbanking">PERSONAL BANKING</Nav.Link>
            <Nav.Link href="shoping">SHOPING</Nav.Link>
            
          </Nav>
          <Nav>
            <Nav.Link href="deets">More deets</Nav.Link>
            <Nav.Link eventKey={2} href="#memes">
              Dank memes
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
    </Navbar>
    </>
    );
}
